#Turns out they all appear around 6000 times, so none of those seem out of place.
#There is a weird amount of spacing between Py and hon, where you would assume that the t should be...
#Lets figure out how many spaces there are as maybe that number can represent something!
stringCopy = finalString
#Replace the spaces with X to make them easier to see, I could just use a count but I want a visual representation.
finalCopy = ""
for ch in stringCopy:
	x = ch
	if ch == " ":
		x = "X"
	finalCopy = finalCopy + x

print(finalCopy)
#Turns out they aren't spaces between Py and thon they appear to be tabs, lets see how many there are!
